import React, { useState } from 'react';
import './App.css';

function App() {
  const [team, setTeam] = useState([]);

  const getTeams = () => {
    fetch('/competitions/')
    .then(res => res.json())
    .then(teams => setTeam({teams}))
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Teams</h1>
      </header>
    </div>
  );
}

export default App;
